import { useState, useEffect } from 'react';
import axios from 'axios';
import Booking from '../components/booking/Booking';
import BottomBar from '../components/navbar/BottomBar';
import Thanks from './Thanks';
import { Link } from 'react-router-dom';

const Processor = () => {
  const [travelers, setTravelers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch data from API using Axios
    axios.get('your_api_endpoint')
      .then(response => {
        setTravelers(response.data); // Assuming response.data is an array of traveler objects
        setLoading(false);
      })
      .catch(error => {
        setError(error);
        setLoading(false);
      });
  }, []);

  return (
    <div className='main' >
    <div className='booking_area w-full' id="back">
      <div className="max-w-6xl w-full px-4 lg:px-0 mx-auto">
      {loading ? (
        <div>Loading...</div>
      ) : error ? (
        <div>Error: {error.message}</div>
      ) : travelers.length === 0 ? (
        <div className="text-center text-4xl text-red-500">No Travelers Available Right Now</div>
      ) : (
        travelers.map(traveler => (
          <div key={traveler.id} className="card">
            {/* Render traveler information in a card */}
            <h2>{traveler.name}</h2>
            <p>{traveler.description}</p>
            {/* You can add more information here */}
          </div>
        ))
      )}
      </div>
    <BottomBar />
    </div>
    </div>
  );
};

export default Processor;
